CREATE TABLE 'test'.'airports' (
  'ID' INT NOT NULL COMMENT '',
  'NAME' VARCHAR(255) NULL COMMENT '',
  'DIVISION_NAME' VARCHAR(255) NULL COMMENT '',
  'COUNTRY_NAME' VARCHAR(100) NULL COMMENT '',
  'CODE' VARCHAR(3) NULL COMMENT '',
  'ICAO_CODE' VARCHAR(4) NULL COMMENT '',
  'LATITUDE' DECIMAL(16,14) NULL COMMENT '',
  'LONGITUDE' DECIMAL(19,16) NULL COMMENT '',
  'ALTITUDE' INT NULL COMMENT '',
  'DST' DECIMAL(4,2) NULL COMMENT '',
  'TZ' VARCHAR(2) NULL COMMENT '',
  'ZONE' VARCHAR(100) NULL COMMENT '',
  PRIMARY KEY ('ID')  COMMENT '');



